import React from 'react';
import { useImagenContext } from '../context';
import './resultados.css';

function ImagenCargada() {
  const { imagen } = useImagenContext();

  return (
    <div className='imgcargada'>
      Imagen Cargada
      <div className='muestraimagen'>
        {imagen.imagenCargada && (
          <div>
            <img
              src={URL.createObjectURL(imagen.imagenCargada)}
              alt={`Imagen Cargada: ${imagen.nombreImagenCargada}`}
              className='result'
            />
            <p>{imagen.nombreImagenCargada}</p>
          </div>
        )}
        {imagen.imagenCapturada && (
          <div>
            <img
              src={imagen.imagenCapturada}
              alt={`Imagen Capturada: ${imagen.nombreImagenCapturada}`}
              className='result'
            />
            <p>{imagen.nombreImagenCapturada}</p>
          </div>
        )}
      </div>
    </div>
  );
}

export default ImagenCargada;
